    <Button variant="outline-secondary" size="xxl">
      Ab zum Stimmungstagebuch!
    </Button>

    <br/>

    <Button variant="outline-secondary" size="xxl">
      Ich möchte an meinen offenen Aufgaben weiterarbeiten
    </Button>

    </div>
  );
}

export default App;
